export const requiredField = value =>{
    if(value) return 'undefined'
    return 'some error'
}
export const  maxLength15 = value =>{
    if(value && value.length > 15) return 'max length more then 15 symbols'
    return 'vso ok'
}
export const  maxLengthCreator = (maxLength) => (value) =>{
    if(value && value.length > maxLength) return 'max length more then 15 symbols'
    return 'vso ok'
}
